"use strict";angular.module("jrutishausergithubio",["ngSanitize","ui.router"]).config(["$stateProvider","$urlRouterProvider",function(e,a){e.state("home",{url:"/",templateUrl:"app/main/main.html",controller:"MainCtrl"}).state("home.about",{url:"/about",templateUrl:"app/about/about.html",controller:"AboutCtrl",controllerAs:"about"}).state("home.work",{url:"/work",templateUrl:"app/work/work.html",controller:"WorkCtrl",controllerAs:"work"}).state("home.blog",{url:"/blog",templateUrl:"app/blog/blog.html",controller:"BlogCtrl",controllerAs:"blog"}),a.otherwise("/")}]),angular.module("jrutishausergithubio").controller("NavbarCtrl",["$scope",function(e){e.date=new Date}]),angular.module("jrutishausergithubio").controller("WorkCtrl",function(){}),angular.module("jrutishausergithubio").controller("MainCtrl",function(){}),angular.module("jrutishausergithubio").controller("BlogCtrl",function(){}),angular.module("jrutishausergithubio").controller("AboutCtrl",function(){}),angular.module("jrutishausergithubio").run(["$templateCache",function(e){e.put("app/about/about.html",'<section class="about"><section class="textbody"><h3>ABOUT ME</h3><p>I’m Jonathan Rutishauser. As you can see, I have a pretty long name, which has given me a lot of nicknames in my lifetime- Rutis, JRu, Jon… I’ll answer to any of them. Most people will tell you I have a lot of hobbies and I tend to dive head first into those hobbies, from brewing beer to whitewater kayaking to computer programming. Over the past decade, programming has always piqued my interest and until recently, remained just another hobby. I spend my free time with my wife, Ally, and our goofy 6-year-old daughter, Averie. After spending the last 8 years in sales and sales management, I decided it was time for a major career change. I signed up for The Iron Yard’s Front End Engineering Program and haven’t looked back since.</p><p>So why do you need me? I love to tinker with just about anything and I’ve found that programming is a true passion for me. Creating awesome projects with the skills I’ve learned through Front End Engineering is exactly what I’m good at. I am genuinely excited to learn new ways to create with JavaScript and learn about all of its many frameworks. Ever since starting with Angular.js, I have been hooked. I am also skilled with HTML, CSS and Sass and if I need a new tool to accomplish a goal, I set out on a mission to find it.</p></section></section>'),e.put("app/blog/blog.html",'<section class="blog"><h3>blog</h3></section>'),e.put("app/main/main.html",'<div class="container"><header><div class="first"><h1>Hello. My name is Jon Rutishauser</h1></div><div class="second"><div class="insecond"><p>AND I</p><p>DREAM</p></div><div class="insecondtoo"><p>about building the internet.</p></div></div><div class="third"><p>I live in sunny Orlando, Florida.</p></div><div class="fourth"><p>Click below to learn more about me.</p></div></header><nav><ul><li><a ui-sref="home.about">ABOUT</a></li><li><a ui-sref="home.work">WORK</a></li><li><a ui-sref="home.blog">BLOG</a></li></ul></nav></div><div ui-view=""></div><section><p>some text</p></section><div class="footer"><p>some awesome line of text here</p></div>'),e.put("app/work/work.html",'<section class="work"><h3>Here are a few things I have built.</h3><section class="hausbrewer"><section class="workimg"><img src="/assets/images/iphonehaus.png" alt="iphone w/ hausbrewer"></section><section class="workdesc"><img src="/assets/images/hblogo.png" alt="hausbrewer logo"><h3>hausbrewer</h3><p>Hausbrewer is a mobile-first streamlined, easy-to-use guide and record keeping application for those new to brewing their own beer. With step-by-step instructions, recipe storage, and fermentation tracking, it’s never been simpler to start your own brew.</p><h4>Tech stack Used</h4><ul class="icons"><li><img src="/assets/images/angular.png" alt="angular"></li><li><img src="/assets/images/firebase.png" alt="firebase"></li><li><img src="/assets/images/node-sass.png" alt="sass"></li><li><img src="/assets/images/gulp.png" alt="gulp"></li><li><img src="/assets/images/yeoman.png" alt="yeoman"></li><li><img src="/assets/images/bower.png" alt="bower"></li></ul><h4>Quick Facts</h4><ul class="facts"><li>Mobile first design using Angular.js.</li><li>Cloud storage with a Firebase backend.</li><li>Project scaffolded with Yeoman generator.</li><li>Tasking and automation by gulp.js.</li><li>Bower package manager used.</li><li>Sass, to give my CSS super powers.</li><li>This project is open source and available on <a href="https://github.com/jrutishauser/hausbrewer">github</a></li><li>Features continuously added.</li></ul></section></section></section>'),e.put("components/navbar/navbar.html",'<nav class="navbar" ng-controller="NavbarCtrl"><a href="https://github.com/Swiip/generator-gulp-angular">Gulp Angular</a><ul><li class="active"><a ng-href="#">Home</a></li><li><a ng-href="#">About</a></li><li><a ng-href="#">Contact</a></li></ul><ul><li><a ng-href="#">Current date: {{ date | date:\'yyyy-MM-dd\' }}</a></li></ul></nav>')}]);